import "./File.css"

let curDate = new Date();
let greet = ' ';
const greetColor = {};


if(curDate >=0  && curDate<=12){
   greet = "Good Morning";
   greetColor.color = "green";
}
else if(curDate>12  && curDate<=14){
    greet = "Good AfterNoon";
    greetColor.color = "orange";
}
else if(curDate>14 && curDate<=24){
    greet = "Good Evening";
    greetColor.color = "blue";
}
else{
    greet = "Good Night";
    greetColor.color = "black";
}




function File(){
    return <div>
        <h2>Hellow Sir , <span style={greetColor}>{greet}</span> </h2>
    </div>
}
